import React, { useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { Button } from 'react-bootstrap';
import './complaint.css';

function Complaint({ handleView }) {
  const navigate = useNavigate();
  const [refresh, setRefresh] = useState(false);
  const [problems, setProblems] = useState([]);

  useEffect(() => {
    const fetchProblems = async () => {
      try {
        // Your API call to fetch problems goes here
      } catch (error) {
        console.error('Error fetching problems:', error);
      }
    };

    // Fetch problems on initial render
    fetchProblems();
  }, [refresh]);

  const handleViewClick = (image) => {
    handleView(image);
    navigate('/image');
  };

  const handleShowLogout = () => {
    localStorage.removeItem("admin");
    navigate("/adminlogin");
  };

  return (
    <div className="complaint-container">

      <div className="complaint-list">
        {problems.map(item => (
          <div className="complaint-item" key={item.id}>
            <div className="complaint-details">
              <div className="complaint-info">
                <strong>Complaint Lodged On:</strong> {item.createdAt}
              </div>
              <div className="complaint-info">
                <strong>Complaint Lodged By:</strong> {item.email}
              </div>
              <div className="complaint-info">
                <strong>Subject:</strong> {item.problem}
              </div>
              <div className="complaint-info">
                <strong>Status:</strong> {item.status}
              </div>
            </div>
            <div className="complaint-image">
              <strong>Image:</strong> <Button variant="outline-primary" onClick={() => handleViewClick(item.Image)}>View</Button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Complaint;
